import React, { useState, useEffect } from 'react';
import { getUserProperties, deleteProperty } from '../services/propertyService';

const Profile = ({ userId, token }) => {
    const [properties, setProperties] = useState([]);

    useEffect(() => {
        const fetchProperties = async () => {
            try {
                const properties = await getUserProperties(userId, token);
                setProperties(properties);
            } catch (error) {
                console.error('Error fetching user properties:', error);
            }
        };
        fetchProperties();
    }, [userId, token]);

    const handleDelete = async (propertyId) => {
        try {
            await deleteProperty(propertyId, token);
            setProperties(properties.filter(property => property.id !== propertyId));
        } catch (error) {
            console.error('Error deleting property:', error);
        }
    };

    return (
        <div>
            <h1>User Profile</h1>
            <h2>My Properties</h2>
            <div className="property-list">
                {properties.map(property => (
                    <div key={property.id} className="property-card">
                        <img src={`http://localhost:5000/uploads/${property.image}`} alt="Property" className="property-image" />
                        <div className="property-details">
                            <h2>{property.title}</h2>
                            <p>{property.description}</p>
                            <p><strong>Location:</strong> {property.location}</p>
                            <p><strong>Price:</strong> ${property.price}</p>
                            <button onClick={() => handleDelete(property.id)}>Delete</button>
                            <button>Edit</button> {/* Implement edit functionality */}
                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default Profile;
